import React, {Component} from 'react'
import logo from '../components/NoRecordFound.png'


class ErrorComponent extends Component{
    render(){
        return (
            <React.Fragment>
                <img alt="" src={logo} />
            </React.Fragment>
        )
    }

}

export default ErrorComponent
